import './App.css';
import BulletinBoardPage from './components/BulletinBoardPage';
import {Grid} from '@material-ui/core'

function App() {

  return (
    <div className="App">
      <h1>HFMY</h1>
      <p>YUI LOOP</p>
      <Grid sm={4}></Grid>
      <Grid sm={4}>
        <BulletinBoardPage/>
      </Grid>
      <Grid sm={4}></Grid>
    </div>
  );
}

export default App;
